(5, NULL, 'SIlk Thread Earrings Jhumka', 'Shape	Round\r\nBrand	CL\r\nSize	Normal\r\nMaterial: Silk Thread – Handmade work\r\nJewelry Type: Silk Thread Earrings\r\nContents: 1 Pair Earrings\r\nSize: Large', 6500, 'DSC_6687-01.jpeg', ',DSC_6687-01.jpeg,DSC_6691-01-min.jpeg,DSC_6682-01-min-min.jpg', 1, '1', '3', '1', '', 1, 1, '3', '10', '39000.00', '11700.00', 1, '2017-09-13 12:41:19', NULL, '2017-10-06 07:38:36', '2', 1),
(6, NULL, ' Pearl Jewellery', 'Details of Necklace Set :\r\nBase	Alloy\r\nFinish	Gold Plated\r\nStone/s	American Diamond & Pearls\r\nStone Colour	White\r\nEarring Type	Stud\r\nLength of Necklace	(40.64 - 45.72 cm) - (16 - 18 inches)\r\nLength of Earring	3.81 cm (1.5 inches)\r\nDetails Of Ring :\r\nBase	Alloy\r\nFinish	Gold Plated\r\nStone/s	Pearl\r\nStone Colour	White\r\nSize of Ring	Adjustable\r\nWarranty: Lifetime Warranty On Pearls Only\r\nPackage Content:\r\n1 Necklace, 1 Pair of Earrings & 1 Ring\r\nJewellery Care:\r\nProtect your jewellery from sharp blows, scratches and extreme temperatures.\r\nAvoid contact with perfumes, sprays, chemicals and water.\r\nKeep your jewellery in a clean, dry and airtight box. Wipe it using a soft cloth regularly.\r\nGold and silver jewellery might get tarnished if not worn regularly. Place anti-tarnish strips in the jewellery box.\r\nFor a complete guide on jewellery care, please click here.\r\nReplacement Policy:\r\nCustomers are requested to report any unfortunate in-transit breakage/damage within 48 hrs from the time of delivery by calling HS18 customer care on 0120-6189818 so that our team can ensure appropriate measures for replacement. Any such reporting after 48 hours does not fall under the Return Policy. However, in case of any manufacturing defect in the product, it will be covered under manufacturer warranty. Please read HomeShop18 Return Policy for more details.', 5000, 'DSC_6731-01-min.jpeg', ',DSC_6732-01.jpeg,DSC_6731-01.jpeg', 1, '1', '1', '1', '5', 1, 1, '5', '5', '25000.00', '23750.00', 1, '2017-09-13 12:47:58', NULL, '2017-10-06 11:57:00', '1', 1),
(9, NULL, 'Maang Tikka', 'multicolour stone with Gold plated Maang Tikka The Stone in the intricately designed ea Maang Tikkas add the perfect glitz to any dress, look or day End your search with Inaya Multicolor and Gold delicate Maang Tikka  If you are looking for something new to complete your look, your search ends here', 100, 'DSC_6774-03-01-min.JPG', ',DSC_6786-01.jpeg,DSC_6774-03-01-min8.JPG', 1, '11', '1,7', '1', '', 1, 0, '7', '0', '1000.00', '1000.00', 1, '2017-09-20 03:58:45', '1', '2017-10-06 11:57:08', '1', 1),
